text:
TWICE (@JYPETWICE) joins BTS as the only #KPOP acts to have 3 or more albums charting multiple weeks at #1 on Billboard World Albums chart

TWICE (@JYPETWICE
) becomes the first #KPOP female act to have 3 albums charting multiple weeks at #1 on Billboard World Albums chart!

TWICE
's “Basics” rises 79 spots to #43 on this week's Circle Global K-Pop chart, their fourth highest peak.

@JYPETWICE
's “Queen of Hearts” rises 86 spots to #36 on this week's Circle Global K-Pop chart, their third highest peak.

@JYPETWICE
's “When We Were Kids” rises 95 spots to #149 on this week's Circle Global K-Pop chart.

@JYPETWICE
's “Gone” rises 99 spots to #125 on this week's Circle Global K-Pop chart.
@JYPETWICE
's “Brave” rises more than 100 spots to #100 on this week's Circle Global K-Pop chart.
